function Greeting() {
  let greeting = "Good\nMorning";
  let time = new Date();
  if (time.getHours() > 18) {
    greeting = "Good\nEvening";
  } else if (time.getHours() > 12) {
    greeting = "Good\nAfternoon";
  }
  return greeting;
}
